Step-by-step reasoning:
1. Key psychological mechanisms include inequality aversion: responders feel a negative utility when the offer is lower than what they deem fair. In the classical Fehr–Schmidt model, a constant fairness norm is used. Here instead we assume that responders learn an expected fair share from the environment.
2. This learning is captured by a trial‐by‐trial update rule in which the expected fair share (m) starts at 0.5 and is updated based on the difference between the actual received share (split_self divided by combined_earning) and the current expectation.
3. The utility of accepting an offer is then modeled as the monetary payoff (split_self) diminished by a penalty proportional to any shortfall relative to the learned fair share. The penalty term is determined by the parameter alpha.
4. Thus we have two learnable parameters: alpha (sensitivity to unfairness) and learning_rate (the rate at which the expected fair share is updated).
5. The mapping to observed behavior is as follows: on a given trial the responder receives an offer (split_self relative to combined_earning), computes the utility, and then their decision (acceptance) is based on that utility. Meanwhile, the expected fair share (m) gets updated, influencing future decisions.

Below is the formal specification:

<MODEL>
U_accept = split_self - alpha * max(m - (split_self/combined_earning), 0);
m_next = m + learning_rate * ((split_self/combined_earning) - m)
</MODEL>

<VARIABLES>
